import React from "react";
import {Nav,NavbarContainer,Navlogo} from './NavbarElements'
const Navbar = () =>{
    return (
    <>
    <Nav>
    <NavbarContainer>
        <Navlogo to = '/'>TheOs</Navlogo>
    </NavbarContainer>
    </Nav>
    </>
    );
};

export default Navbar;
